import React from "react";
import { Grid, Label, Box, Input, Textarea, Button, Flex, Image, Text } from "theme-ui";


const ReviewBoxes = (props) => {
    return(
        <Flex sx={{backgroundColor: 'navy50', px: '10px', py: '30px', borderRadius: '10px'}}>
            Body: {props.body}
            Rating: {props.rating}
        </Flex>
    )
}

export default ReviewBoxes;
